CREATE TABLE trails(
   Trial            VARCHAR(50) NOT NULL PRIMARY KEY
  ,Tip              VARCHAR(50) NOT NULL
  ,Lance_Flow       INTEGER  NOT NULL
  ,NGIMU_Mount_Type VARCHAR(50) NOT NULL
  ,NGIMU_Position   VARCHAR(50) NOT NULL
  ,Bath_Start_Depth NUMERIC(50,2) NOT NULL
  ,Immersion        NUMERIC(50,2) NOT NULL
  ,Data_Points      INTEGER  NOT NULL
);
